import React from "react";

function Icon() {
  return (
    <div className="navigation-logocontainer">
      <div className="logo-class">
        <span>CLASS</span>
      </div>
      <div className="logo-101">
        <span>IOI</span>
      </div>
    </div>
  );
}

export default Icon;
